Confidential Information. 5.1 Except as provided in clause 5.2, no party shall, and each party shall procure that their Representatives shall not, disclose to any third party, or use or exploit commercially for its or their own purposes, any Confidential Information. The obligations of the parties under this clause 5.1 shall remain in force until the relevant information enters the public domain otherwise than by the default of a party. 5.2 The obligations of confidentiality in clause 5.1 do not apply in respect of the disclosing of Confidential Information in the following circumstances:

 (a) in connection with the performance of each party's obligations hereunder or the enforcement of its rights hereunder;

 (b) to its Affiliates and the directors, officers, employees, agents, and professional advisers or its and/or their Affiliates (the"Representatives") on a need to know basis to the extent reasonably required for purposes connected with this Agreement;   6





 (c) pursuant to any listing agreement with or the rules and regulations of any recognised security exchange on which securities of suchParty or any of its Affiliates are listed and/or traded;

 (d) as required by Applicable Law,

provided in each case set out in Clauses 5.2(a) and 5.2(b) above, the Party disclosing the same shall take all reasonable steps to preserve the confidentiality thereof and to ensure that such information shall be used only for the purposes for which it has been disclosed. 5.3 If a Party becomes required, in circumstances contemplated by Clauses 5.2(c) or 5.2(d), to disclose any information, such party shall (save to the extent prohibited by such rules and regulations or Applicable Law) give to the other party such notice as is practical in the circumstances of such disclosure and shall co-operate with the other party, having due regard to the other party's views, and take such steps as the other party may reasonably require in order to enable it to mitigate the effects of, or avoid the requirements for, any such disclosure.
